import React, { useState } from 'react';
import {
  Dialog,
  DialogActions,
  DialogContent,
  DialogContentText,
  DialogTitle,
  Button,
  TextField,
  Select,
  MenuItem,
  FormControl,
  InputLabel,
} from '@mui/material';
import axios from 'axios';

const WorkOrderFormModal = ({ open, handleClose }) => {
  const [formData, setFormData] = useState({
    taskType: '',
    roomNumber: '',
    details: '',
    priority: 'Medium',
    attachments: []
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleFileChange = (e) => {
    setFormData({ ...formData, attachments: e.target.files });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('/api/work-orders', formData, {
        headers: { Authorization: `Bearer ${localStorage.getItem('token')}` }
      });
      console.log(response.data);
      handleClose(); // Close modal after successful submission
    } catch (error) {
      console.error('Error creating work order:', error);
    }
  };

  return (
    <Dialog open={open} onClose={handleClose} maxWidth="md" fullWidth>
      <DialogTitle>Create New Work Order</DialogTitle>
      <DialogContent>
        <DialogContentText>
          Please fill out the form to create a new work order.
        </DialogContentText>
        <form onSubmit={handleSubmit}>
          <FormControl fullWidth margin="normal">
            <InputLabel>Task Type</InputLabel>
            <Select
              name="taskType"
              value={formData.taskType}
              onChange={handleChange}
              required
            >
              <MenuItem value="Clean Up / Spill">Clean Up / Spill</MenuItem>
              <MenuItem value="Cooling Issue">Cooling Issue</MenuItem>
              <MenuItem value="Electrical Issue">Electrical Issue</MenuItem>
              <MenuItem value="Equipment Repairs">Equipment Repairs</MenuItem>
              <MenuItem value="Fire Safety">Fire Safety</MenuItem>
              <MenuItem value="General Maintenance Request">General Maintenance Request</MenuItem>
              <MenuItem value="Health and Safety">Health and Safety</MenuItem>
              <MenuItem value="Heating Issues">Heating Issues</MenuItem>
              <MenuItem value="Lighting Issues">Lighting Issues</MenuItem>
              <MenuItem value="Mechanical Issues">Mechanical Issues</MenuItem>
              <MenuItem value="Painting / Touch Ups">Painting / Touch Ups</MenuItem>
              <MenuItem value="Pest Control">Pest Control</MenuItem>
              <MenuItem value="Plumbing Issues">Plumbing Issues</MenuItem>
              <MenuItem value="Waste Issues">Waste Issues</MenuItem>
            </Select>
          </FormControl>
          <TextField
            margin="normal"
            name="roomNumber"
            label="Room Number"
            fullWidth
            value={formData.roomNumber}
            onChange={handleChange}
            required
          />
          <TextField
            margin="normal"
            name="details"
            label="Details"
            multiline
            rows={4}
            fullWidth
            value={formData.details}
            onChange={handleChange}
            required
          />
          <FormControl fullWidth margin="normal">
            <InputLabel>Priority</InputLabel>
            <Select
              name="priority"
              value={formData.priority}
              onChange={handleChange}
              required
            >
              <MenuItem value="Low">Low</MenuItem>
              <MenuItem value="Medium">Medium</MenuItem>
              <MenuItem value="High">High</MenuItem>
            </Select>
          </FormControl>
          <input
            type="file"
            name="attachments"
            multiple
            onChange={handleFileChange}
            style={{ marginTop: '20px' }}
          />
          <DialogActions>
            <Button onClick={handleClose} color="secondary">
              Cancel
            </Button>
            <Button type="submit" color="primary" variant="contained">
              Submit
            </Button>
          </DialogActions>
        </form>
      </DialogContent>
    </Dialog>
  );
};

export default WorkOrderFormModal;
